import React from "react";
function LoginButton()
{
    return (
        <div>
            <button><a href="http://localhost:3000/login">Войти</a></button>
            <button><a href="http://localhost:3000/singup">Зарегистрироваться</a></button>
        </div>
    );
  }
  export default LoginButton;
